import { Link } from "react-router-dom"

const Header = () => {
    return(
        <div style={{display: "flex", flexDirection: "column"}}>
            <Link to = "/Home">Home</Link>
            <Link to = "/Login">Login</Link>
            <Link to = "/SignUp">SignUp</Link>
        </div>
    )
}

export default Header
